МАСЛО "Злата пальма" ИСПОЛЬЗУЮТ:

- для улучшения структуры волос и предотвращения ломкости и расслоения ногтей 

- при пародонтозах рекомендуется на десна накладывать марлевые салфетки, пропитанные красным маслом

- при тепловых или солнечных ожогах можно смазывать пораженные участки кожи

- для избавления от ороговелости подошвы и пяток рекомендуется делать масля-ные компрессы на ночь 

- для ухода за кожей лица и тела можно добавлять в крема красное пальмовое масло

- при эрозии шейки матки 

- при трещинах сосков у кормящих матерей можно смазывать соски

- при запорах, геморроях, трещинах прямой кишки 

Изготовлено из отборных свежих плодов пальмы, выращенных и обработанных согласно лучшим сельскохозяйственным и производственным нормам; 
100% натуральный и экологически чистый продукт, без красителей и добавок; 
богато каротиноидами (провитамин А), токоферолами и токотриенолами (вита-мин Е), поли и мононенасыщенными жирными кислотами; 
высокое йодное число 64-70 и больше; 
генетически не модифицировано; 
не содержит трансизомеров жирных кислот.
